import React from "react";
import Navbar from "../components/Navbar";
import "../styles/work.css";

function Work() {
  return (
    <div className="work-container">
      <Navbar />
      <h1>Our Work</h1>
      <p>Explore our portfolio of cutting-edge knitwear...</p>
    </div>
  );
}

export default Work;
